import React, { Component, Button } from "react";
import "./App.css";
import "./components/MapContainer";
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import Landing from "./components/landingpage";
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";
import MapContainer from "./components/MapContainer";

const mapStyles = {
  width: "100%",
  height: "100%"
};

class App extends Component {
  constructor() {
    super();
    this.test = this.test.bind(this);
  }
  state = {
    showMap: false
  };

  test() {
    this.setState({ showMap: true });
  }

  render() {
    return (
      <div className="demo-big-content">
        <Layout>

          <Header className="header-color" title="Road Trip Advisor" scroll>
            {this.state.showMap ? <MapContainer /> : null}
            <Router>
            <Navigation>
              <Link to="/home">Home</Link>
              <Link to="/plan-a-trip">Plan a trip</Link>
              <Link to="/sign-up">Sign Up</Link>
              <Link to="/sign-in">Sign In</Link>
              <Link to="/current-location">Current Location</Link>

            <Switch>
              <Route exact path="/"/>
              <Route path="/current-location" component={MapContainer}/>
            </Switch>
            </Navigation>
            </Router>
          </Header>
          <Content>
            <div className="page-content">
              <Landing />
            </div>
          </Content>
        </Layout>
      </div>
    );
  }
}
export default App;
